import React from "react";
import FileUploader from "./components/FileUploader";
import logo from "./logo.png";
import "./App.css";

function App() {
	return (
		<div className="app-container">
			<header className="app-header">
				<img src={logo} alt="preguntator-logo" className="logo" />
			</header>
			<main className="app-content">
				<FileUploader />
			</main>
			<footer className="app-footer">{/* Contenido del footer */}</footer>
		</div>
	);
}

export default App;
